import { Nosotros } from "./pages/nosotros/nosotros";
import { Contactanos } from "./pages/contactanos/contactanos";
import { NotFoundPage } from "./pages/errorPages/notFound"

export function App() {
  return (
    <Fragment>

      <Header />

      
      <Footer />
    </Fragment>
  );
}
